        console.log(`/card/${user}`);
    },[]);

        
        return(
            <div 
            className = "ui raised very padded text container segment"
            style = {{marginTop: "80px"}}
            >
             <h3 className = "ui header">Cardjjjjj</h3>
            </div>
        )
  
}

export default Card;
